const premiumRoles = ["330919872630358026", "402175094312665098", "436013049808420866", "436013613568884736", "396390444738674691"];

module.exports = function premium(user) {
	var member = user.client.guilds.get("330913265573953536").member(user.id);
	var premium = (member.roles.some(role => premiumRoles.includes(role.id))) ? true : false;
	return premium;
}
